}</style><style type="text/css">.overlay {
  display: -ms-flexbox;
  display: flex;
  -ms-flex-flow: row wrap;
      flex-flow: row wrap;
  font-weight: bold;
  text-align: center;
  background-color: #025;
}

.overlay>* {
  padding: 3px;
  -ms-flex: 1 100%;
      flex: 1 100%;
}

.header {
  background: #025;
  color: #F50;
  -ms-flex-align: stretch;
      align-items: stretch;
  /* margin: 5px; */
  /* padding: 5px; */
}

.restart-button {
  -ms-flex: 1 35px;
      flex: 1 35px;
  margin: 4px;
  padding: 1px;
  -ms-flex-line-pack: center;
      align-content: center;
  /* background-color: #349; */
}

.titleField {
  display: -ms-flexbox;
  display: flex;
  -ms-flex: 2 80%;
      flex: 2 80%;
  background-color: #24A;
  margin: 4px;
  /* padding: 10px; */
  border-radius: 60px;

  -ms-flex-align: center;

      align-items: center;
}

.titleText {
  -ms-flex: 1;
      flex: 1;
  font-weight: 900;
  color: #F50;
  font-size: 25px;
}

.clock {
  -ms-flex: 3 20%;
      flex: 3 20%;
  color: rgb(255, 212, 131);
  font-size: 15px;
  font-weight: 1000;
  white-space: pre-wrap;
  background-color: #24A;
  margin: 4px;
}

@media all and (min-width: 700px) {
  .header {
    display: -ms-flexbox;
    display: flex;
  }
  .column1 {
    -ms-flex: 1 25%;
        flex: 1 25%;
  }
  .column2 {
    -ms-flex: 1 25%;
        flex: 1 25%;
  }
  .column3 {
    -ms-flex: 1 50%;
        flex: 1 50%;
  }
  .tablebody {
    display: -ms-flexbox;
    display: flex;
  }
}

.tablebody {
  background-color: #24A;
  margin-left: 4px;
  margin-right: 4px;
  margin-bottom: 4px;
  padding: 2px;
  border-radius: 10px;
}

.column1 {
  border-radius: 10px;
  padding: 4px;
  background-color: tomato;
  margin: 2px;
}

.column2 {
  background-color: turquoise;
  margin: 2px;
}

.column3 {
  /* background-color: rgb(3, 99, 0); */
  margin: 2px;
}

.db_buttons {
  /* background-color: rgb(228, 76, 56); */
  display: -ms-flexbox;
  display: flex;
  -ms-flex-align: stretch;
      align-items: stretch;
  border-radius: 20px;
}

.db_button {
  -ms-flex: 1;
      flex: 1;
  margin-top: 2px;
  margin-bottom: 2px;
}

.db_stats {
  background-color: rgb(255, 114, 71);
}

.db_sometext {
  padding: 10px;
  background-color: rgb(255, 145, 71);
}

.github_last_repos {
  background-color: rgb(116, 225, 90);
  /* margin-top: 5px; */
  border-radius: 15px;
  border-bottom-left-radius: 80%;
  padding: 20px;
}

.github_graphs {
  background-color: rgb(180, 255, 140);
  border-radius: 0.7cm;
  border: violet;
}

.App-logo {
  animation: App-logo-spin infinite 7s linear;
  width: 100px;
  height: 100px;
  padding: 10px;
}

@keyframes App-logo-spin {
  from {
    transform: rotate(0deg);
  }
  to {
    transform: rotate(360deg);
  }

/*
 * DOM element rendering detection
 * https://davidwalsh.name/detect-node-insertion
 */
@keyframes chartjs-render-animation {
	from { opacity: 0.99; }
	to { opacity: 1; }
}

.chartjs-render-monitor {
	animation: chartjs-render-animation 0.001s;
}

/*
 * DOM element resizing detection
 * https://github.com/marcj/css-element-queries
 */
.chartjs-size-monitor,
.chartjs-size-monitor-expand,
.chartjs-size-monitor-shrink {
	position: absolute;
	direction: ltr;
	left: 0;
	top: 0;
	right: 0;
	bottom: 0;
	overflow: hidden;
	pointer-events: none;
	visibility: hidden;
	z-index: -1;
}

.chartjs-size-monitor-expand > div {
	position: absolute;
	width: 1000000px;
	height: 1000000px;
	left: 0;
	top: 0;
}

.chartjs-size-monitor-shrink > div {
	position: absolute;
	width: 200%;
	height: 200%;
	left: 0;
	top: 0;
}
